import React, { useState, useEffect } from 'react'
import axios from "axios"
const Url = "https://api.creativecommons.engineering/v1/images"


export default function App() {

  const [countries, updateCountries] = useState([])
  useEffect(() => {
    const apiCall = async () => {
      const countries = await axios(countryUrl)
      updateCountries(countries.data)
    }
    apiCall()
  }, [])


  return (
    <div>
      <h1>Countries</h1>
      {countries.map(country => <h2 key={country.nativeName}>{country.nativeName}</h2>)}
    </div>
  )
}
